import { Route, Routes } from "react-router-dom";
import OdjelList from "./OdjelList";
import Nesto from "./nesto";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" component={OdjelList} exact />
        <Route path="/nesto" component={Nesto} />
      </Routes>
    </div>
  );
}

export default App;
